import React, {Component} from 'react';
import {BrowserRouter, Route} from "react-router-dom";

import Home from './pages/Home';
import Navbar from './components/Navbar';
import Begeleiding from './pages/Begeleiding';
import Professionals from './pages/Professionals';
import Informatie from './pages/Informatie';
import Contact from './pages/Contact';
import Axios from 'axios';
import APIENDPOINT from "./ApiEndpoint";
import Login from "./pages/Login";
import PopUpHome from "./components/HomePopup";
import MoreInfo from "./pages/MoreInfo";

class App extends Component {
    constructor(props) {
        super(props);
        this.state = {
            professionals: []
        }
    }

    componentDidMount() {
        Axios.get(`${APIENDPOINT}/professionals`)
            .then(response => {
                const {data} = response;
                const professionals = Object.values(data);
                this.setState({professionals});
            })
            .catch(err => {
                console.log(err);
            })
    }

    render() {
        return (
            <BrowserRouter>
                <div className="App">
                    <Navbar/>
                    <Route exact path='/' render={() => (
                        <Home professionals={this.state.professionals}/>
                    )}/>
                    <Route path='/Professionals' render={() => (
                        <Professionals professionals={this.state.professionals}/>
                    )}/>
                    <Route path='/Login' component={Login}/>
                    <PopUpHome/>
                    <Route path='/Begeleiding' component={Begeleiding}/>
                    <Route path='/Informatie' component={Informatie}/>
                    <Route path='/Contact' component={Contact}/>
                    <Route path='/MoreInfo' component={MoreInfo}/>
                </div>
            </BrowserRouter>
        );
    }
}

export default App;
